import React, { Component } from 'react';
import './heading.css'
import Navbar from 'react-dom';
import Nav from 'react-dom';
import Form from 'react-dom';
import FormControl from 'react-dom';
import Button from 'react-dom';


class Heading extends Component {
    render() { 
      return(
      <header class = "container">
        <img src={teamLogoImg}></img>
      </header>  
      );
    }
}
const teamLogoImg = require('./court-logo.jpg');
export default Heading;
